import React from 'react';
import "./index.css";

function form(){
    return(
        <>
        <h1 className="temp"> It's a Function.</h1>
        <h1 className="temp">Hello World!!!</h1>
        <img src="https://picsum.photos/200"  alt="Random Image"></img>
        </>
    )
}
export default form;
